(function ($) {
  "use strict";

  $(document).ready(function () {

    // Click join button when row is clicked.
    $('.top-3-cta .view-content li, .oddsshark-approved .view-content li').click(function (event) {
      // Do not fire if review link was clicked.
      if (!$(event.target).hasClass('review-link') && !$(event.target).parent().hasClass('review-link')) {
        $('.join-button, .join', $(this)).trigger('click', true);
      }
    });

    // Join button click method.
    $('.top-3-cta .view-content .join-button, .oddsshark-approved .view-content .join').on('click', function (event, triggered) {
      // Stop propagation
      event.stopPropagation();

      if (triggered) {
        // LI was clicked, trigger native link click.
        event.target.click();
      } else {
        // Native link click.

        // If dataLayer is defined.
        if (typeof dataLayer !== 'undefined') {
          // Gather affiliate details.
          var eventCategory = 'affiliate links - Top 3 CTA';
          if ($(event.target).hasClass('join-button')) {
            eventCategory = eventCategory + ' - Version B';
          }
          if ($(event.target).parents('.casino').length) {
            eventCategory = eventCategory + ' - Casino';
          }
          if ($(event.target).parents('.daily-fantasy').length) {
            eventCategory = eventCategory + ' - Daily Fantasy';
          }
          var affiliatePath = $(this).attr('href');
          var affiliateName = affiliatePath.replace(/\/sites\/all\/links\/|\.php/g, '');

          // Push to GTM.
          dataLayer = dataLayer || [];
          dataLayer.push({
            'event': 'affiliate',
            'eventCategory': eventCategory,
            'eventAction': affiliateName,
            'eventLabel': affiliatePath });

        }

      }
    });

  });
})(jQuery);
